description: >
  4th Edition Cuban Intensive Workshops Aturitmowien💫💥💢


  ✌️ Don't miss this weekend from 22.11.-24.11.2024, full of new styles in Cuban salsa.


  👉👉We will welcome two great artists: @laura.delvecchio87 and @rubenymanuela. With dedication and experiences in the dance world they will take you by the hand on a fascinating journey through the rich history and vibrant moves of Cuban salsa. From the most basic steps to complex combinations, these intensive workshops will allow you to perfect your technique, expand your repertoire and immerse yourself in the passion and joy of Cuban salsa.

  🙌We have also prepared special surprises at the "Fiesta Havanna", such as exclusive practice sessions and networking opportunities with other dance enthusiasts, where you can put into practice everything you've learned.


  📕Sign up now and join us for an unforgettable weekend of music, movement and fun.

  Register now for the Cuban Intensive Workshops before spots run out!


  📧E-mail: aturitmo@gmx.at

  ☎️Tel: +43 676 8325 0264


