  - Early Bird: 140 € (for the first 15 tickets)

  - Price couple leader and follower: 130 €

  - Normal Price: 155 €

  - Single ticket: 60€


  Programme:

  Friday (22.11.2024)  18:00 - 21:10

  Saturday (23.11.2024)  12:00 - 15:10

  Sunday (24.11.2024) 12:00 - 15:10 
